import { useState } from "@webpack/common";

/*
 * Credits to our Mascot square go to the original Artist, a bug in the not-nexulien settings.
 * All rights given because its too uncreative to be copyrighted.
 */

interface SingleDate {
    month: number,
    day: number;
}
interface SpanDate {
    startDate: SingleDate,
    endDate: SingleDate;
}

const API = "https://api.zoid.one/nexulien/assets/";
const TEMP_MASCOT_IMAGE = "https://raw.githubusercontent.com/not-nexulien/nexassets/refs/heads/main/mascot.png";

const LQ_FALLBACK_B64 = "data:image/png;base64,";

export function NxMascot({ ...props }) {
    const [loaded, setLoaded] = useState(false);

    return (
        <img
            className={`${"nx-mascot"}`} {...props}
            style={{
                marginLeft: "auto",
                backgroundImage: !loaded ? "url(" + LQ_FALLBACK_B64 + ")" : "none",
                backgroundSize: 64
            }}
            src={TEMP_MASCOT_IMAGE}
            role="presentation"
            alt=""
            draggable="false"
            height={64}
            width={64}
            onLoad={() => setLoaded(true)}
        ></img>
    );
}
